    return (
        <div className="row">
        <div className='col-sm-12 col-lg-6 col-xl-4'>
          <div className="card">
            <div className="card-title">{props.title}</div>
            <div className="card-content">{props.content}</div>
          </div>
        </div>
      </div>
    );
}
